import React from 'react';

function Testimonial(props) {
    return (
        <div>
            <img src={require(`${props.image}`)}/>
            <h1>{props.name}</h1>
            <p>{props.rating}</p>
            <p>{props.text}</p>
        </div>
    );
}

export default Testimonial;
